import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Emulate a mobile device viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // --- Automation Logic ---

    // 1. Open the mobile menu
    const menuButton = page.locator('div.nav-menu:has-text("All")');
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // 2. Wait for the menu to be visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // 3. Take a screenshot of the open menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // 4. Extract text from a menu item to verify content
    const electronicsLink = page.locator('.mobile-menu a:has-text("Electronics")').first();
    const linkText = await electronicsLink.textContent();

    // 5. Close the mobile menu
    const closeButton = page.locator('.mobile-menu button.close-mobile-menu').first();
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // 6. Wait for the menu to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    // 7. Take a final screenshot to show the menu is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, verified, and closed the mobile navigation menu.",
      extractedData: {
        verifiedMenuItem: linkText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    const errorScreenshotPath = path.join(screenshotsDir, 'error_state.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
